import React, { Suspense } from "react"
import { Route } from "react-router"
import Loader from "../../reuseable/Loader/Loader"


const historialRoutes = ({match}) => {

    const Historical = React.lazy(()=>import("./Historical"))

    return (
        <Suspense fallback={<Loader/>}>
            <Route path={match.path} component={Historical}/>
        </Suspense>
    )
}

export default historialRoutes
